import React from 'react';
import Menu from '../../components/menu';
import Rodape from '../../components/rodape';
import { Carousel, Jumbotron, Button, Container, Row, Col, Card } from 'react-bootstrap';

const Home = () => {
    return (
        <div>
            <Menu />
            <Carousel>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src="https://www.mundodomarketing.com.br/images/inteligencia_up/materias-resumo/artigo-evento.jpg"
                        alt="First slide"
                    />
                </Carousel.Item>
            </Carousel>

                

            <Rodape />
        </div>
    )
}

export default Home;
